import React, { Component } from 'react'
import FineUploaderTraditional from 'fine-uploader-wrappers'
import Gallery from 'react-fine-uploader'

// ...or load this specific CSS file using a <link> tag in your document
import 'react-fine-uploader/gallery/gallery.css'

const uploader = new FineUploaderTraditional({
    options: {
        callbacks: {
            onAllComplete: function(data) {
            console.log(data)
            },
            onComplete: function(data) {
                console.log(data)
                },

        },
        chunking: {
          enabled: true,
          concurrent: {
              enabled: true
          },
          success: {
            endpoint: "http://127.0.0.1/api/videos/processVideo"
        }
        },
        // deleteFile: {
        //     enabled: true,
        //     endpoint: '/api/videos/uploadChunks'
        // },
        debug: true,
        request: {

            endpoint: 'http://127.0.0.1/api/videos/uploadChunks?name=randomFileName',

        },
        retry: {
            enableAuto: true
        }
    }
})
const statusTextOverride = {
  upload_successful: 'Success!'
}
class App extends Component {
    render() {
        return (
            <Gallery status-text={ { text: statusTextOverride } } uploader={ uploader } />
        )
    }
}

export default App
